export const linking = {
    prefixes: ['travelquest://', 'https://travelquest.com'],
    config: {
        screens: {
            ResetPassword: 'reset-password',
            Login: 'login',
            Register: 'register',
            Main: {
                screens: {
                    Map: 'map',
                    Missions: 'missions',
                    Journal: 'journal',
                    Profile: 'profile',
                },
            },
        },
    },
};
